CREATE TABLE `orders` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `nomor_order` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `tanggal_order` date NOT NULL,
  `tujuan_kirim` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `no_tiket_do` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
