  `processing_history` json DEFAULT NULL COMMENT 'Processing history JSON',
  `tipe_kontainer` enum('fcl','lcl','cargo','fcl_plus') COLLATE utf8mb4_unicode_ci NOT NULL,
  `tanggal_pickup` date DEFAULT NULL,
  `satuan` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `exclude_ftz03` tinyint(1) NOT NULL DEFAULT '0',
  `include_ftz03` tinyint(1) NOT NULL DEFAULT '0',
  `exclude_sppb` tinyint(1) NOT NULL DEFAULT '0',
  `include_sppb` tinyint(1) NOT NULL DEFAULT '0',
  `exclude_buruh_bongkar` tinyint(1) NOT NULL DEFAULT '0',
  `include_buruh_bongkar` tinyint(1) NOT NULL DEFAULT '0',
  `term_id` bigint unsigned DEFAULT NULL,
  `pengirim_id` bigint unsigned DEFAULT NULL,
  `jenis_barang_id` bigint unsigned DEFAULT NULL,
  `status` enum('draft','confirmed','processing','completed','cancelled') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'draft',
  `catatan` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `orders_nomor_order_unique` (`nomor_order`),
  KEY `orders_term_id_foreign` (`term_id`),
