  KEY `orders_jenis_barang_id_foreign` (`jenis_barang_id`),
  KEY `orders_tujuan_ambil_id_foreign` (`tujuan_ambil_id`),
  CONSTRAINT `orders_jenis_barang_id_foreign` FOREIGN KEY (`jenis_barang_id`) REFERENCES `jenis_barangs` (`id`) ON DELETE SET NULL,
  CONSTRAINT `orders_pengirim_id_foreign` FOREIGN KEY (`pengirim_id`) REFERENCES `pengirims` (`id`) ON DELETE SET NULL,
  CONSTRAINT `orders_term_id_foreign` FOREIGN KEY (`term_id`) REFERENCES `terms` (`id`) ON DELETE SET NULL,
  CONSTRAINT `orders_tujuan_ambil_id_foreign` FOREIGN KEY (`tujuan_ambil_id`) REFERENCES `tujuan_kegiatan_utamas` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
